24 Pack Dearskin Hand Sanitizer 60ml, 2 Fl Oz
Dearskin Hand sanitizer Kills 99.9% of the most common germs!
- Clean and Refreshing Moisturizing;
- Long-Lasting Antibacterial;
- Easy to use, hard to waste; -
75% Alcohol;
Drug Facts: Active ingredients: - Alcohol 75% v/v. Antiseptic. Use: Hand sanitizer to help reduce bacteria that potentially can cause disease. For use when soap and water are not available. For external use only. Flammable. Keep away from or flame. Do not use: - In children less than 2 months of age. - On open skin wounds. When using this product keep out of eyes, and mouth. In case of contact with eyes, rinse eyes thoroughly with water. Stop use and ask a doctor if irritation or rash occurs. These may be sings of a serious condition. Keep out of reach of children. If swallowed, get medical help or contact a Poison Control Center right away. Directions: - Place enough product on hands to cover all surfaces. Rub hands together until dry. - Supervise children under 6 years of age when use this product to avoid swallowing. Other information: Store between 15-30C (59-86F). Avoid freezing and excessive heat above 40C (104F). Inactive ingredients: Deionized Water, Aloe Barbadensis Extract, Carbomer, Arginine. Distributed by: Dearskin LLC, FL.

2 in 1 Hair & Body Massage Brush
Double sided unique design brush, the softer side fits for the body and face for cleaning your skin deeply, the harder side to do hair scalp massage for the head, one brush meets all your needs;
Hair Scalp Massager Shampoo Brush
Using this shampoo brush to clean hair, good to remove dandruff and remove hardened sebum & dirt; You can enjoy a relaxing scalp massage every time you wash your hair, increase the blood circulation for daily health care and help stimulate the scalp, thereby promoting natural hair growth;
Soft Body Back Scrubber for Shower
The soft bristles side can rapidly foaming, convenient and easy to clean, deep clean your body and give you a comfortable massage feeling, perfectly relax muscle and relieve stress, promote blood circulation;
Portable and Practical Shower Brush
This head massage brush is ergonomically designed, with non-slip design at both ends, easy to hold well during use for men and women, suitable for all kinds of hairstyles, thick or thin, short or long, wet or dry;
Easy to Storage & Perfect Size
The body brush is designed with hang hole, and our package comes with a hook, helps hang on the bathroom door or wall; This head massage is 5 x 2.5 x 1.6 inches, perfect size to use at home or on trip, suitable for men, women, kids and pets;
